import './App.css';

function App() {
  return (
    <div className="App">
      <>
        <h1>โปรแกรม รายรับ - รายจ่าย</h1>
        <p>บันทึกข้อมูลในแต่ละวัน</p>
        <ul>
            <li>ค่าเดินทาง <span>-200</span></li>
        </ul>
      </>
    </div>
  );
}

export default App;
